def binary_search_cube_root(n):
    """Целочисленный кубический корень через бинарный поиск"""
    if n == 0:
        return 0

    low, high = 1, n
    while low <= high:
        mid = (low + high) // 2
        mid_cubed = mid * mid * mid

        if mid_cubed == n:
            return mid
        elif mid_cubed < n:
            low = mid + 1
        else:
            high = mid - 1

    return high  # Округляем вниз

